import React from 'react';

const Banner = () => {
    return (
        <div className="container-fluid"> 
            <div className="p-5 text-center bg-light">
                <h2 className="mb-3">Developer Challenge</h2>
                <h6 className="mb-3">By <a href="https://linkedin.com/in/julie-exel" rel="noreferrer" title="View My LinkedIn" >Julie Exel</a></h6>
            </div>
        </div>
    )
}
  

export default Banner;
